156 => 'a:8:{s:6:"values";a:13:{s:15:"b47e3zacbicokh2";s:518:"<p class="lead">A wonderful serenity has taken possession of my entire soul, like these sweet mornings of spring which I enjoy with my whole heart. I am alone, and feel the charm of existence in this spot, which was created for the bliss.</p>
